import { CButton, CForm, CImage, CCol, CFormLabel, CFormInput } from '@coreui/react';
import workingImage from '../images/illustration-working.svg'
import ShortLinkApi from '../api/ShortLinkApi';
class Content extends React.Component {

    state = {
        listLink: [
            { id: 'todo1', title}
        ]
    }
    render() {
        return (
            <div className='Content'>
                <div className='Head-content'>
                    <div className='Text-content'>
                        <h1>More than just shorter links</h1>
                        <p>Build your branch's recognition and get detailed insights on how your links are performing</p>
                        <CButton className='Get-started-btn button' color="secondary">Get Started</CButton>
                    </div>
                    <CImage className="workingImage" fluid src={workingImage} />
                </div>


                <div className="Shorten-input">
                    <CForm className="row g-3">

                        <CCol xs="auto">
                            <CFormLabel htmlFor="inputPassword2" className="visually-hidden ">
                                Shorten a link here..
                            </CFormLabel>
                            <CFormInput type="text" id="inputPassword2" className='link-input' placeholder="Shorten a link here.." />
                        </CCol>
                        <CCol xs="auto">
                            <CButton type="submit" className="mb-3 link-submit ">
                                Shorten it!
                            </CButton>
                        </CCol>
                    </CForm>
                </div>

                <ShortLinkApi />

            </div>


        );

    }
}

export default Content;
